import React from 'react';
import { Form, Button, Container, Col, Row, Modal, FormCheck } from 'react-bootstrap';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';
import Login from '../src/Login';
import useToken from '../src/useToken';
import Screening from '../src/Screening';
import Main from '../src/Main'
import {useState, setState} from 'react';
import Result from './result';
import { Component } from 'react';
import Entry from './entry';
import {useHistory} from 'react-router-dom'
import NDI from './ndi-rosa';

function Application() {
  const [show, setShow] = useState(false);
  const [checked, setChecked] = useState(false);
  const handleClose = () => setShow(false);
  const history = useHistory();
  const handleSubmit = async e => {
    e.preventDefault();
    if (checked === true){
    history.push('/entry');
    }
    else{
      alert('Please agree to our terms & condition.');
    }
  }
  const handleShow = async e => {
    setShow(true);
    setChecked(e.currentTarget.checked)
    e.preventDefault();
  }
    return(
    <div className="wrapper">
          <div className="welcome">
          <h1></h1> 
          <p id="euHabit">euHabit.</p> 
          <p class="mt-5" id="text-welcome"></p>
          </div>
          <Container>
           <Row>
              <Col>
                <Form id="terms-checkbox">
                  <Form.Group controlId="formBasicCheckbox">
                    <Form.Check checked={checked} onClick={handleShow} type="checkbox" label=" euHabit" />
                  </Form.Group>
                </Form>
              </Col>
            </Row>
          </Container>
          
          <Modal id="Modal"
            show={show}
            onHide={handleClose}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
        <Modal.Title>Terms and Privacy</Modal.Title>
      </Modal.Header>
    
      <Modal.Body>
        <p>
       <b> </b><br/>
     "euHabit"  MNT MediTech     ( "euHabit", "", "", "", "")
    
         
    
             
    
             
    
          
    
    
      (       )         
            
           
        ""          
             
                       ()                         
    
               ()  (1)  (2)  (3)   (4) 
    
    
            
                        
                            
    
                   "euHabit"           
    
       
    
    
     
            
      
      "euHabit"   
    
    -
    -- 
    
    
     / 
       
          
    
    
    
    
        </p>
      </Modal.Body>
    
      <Modal.Footer>
        <Button variant="secondary" onClick={handleClose}>Close</Button>
      </Modal.Footer>
    </Modal>
          <p class="mt-4 Next-button">
          <Button class="btn" onClick={handleSubmit} variant="dark" id="btn-login" type="submit"><b>Next</b></Button>
          </p>
        </div>
          
      );
    }
    
    



function App() {
  const { token, setToken } = useToken();

  if(!token) {
    return <Login setToken={setToken} />
  }
  return(
    <BrowserRouter>
    <Switch>
    <Route exact path="/">
      <Application />
    </Route>
    <Route path="/main">
      <Main />
    </Route>
    <Route exact path='/entry' component={Entry} />
    <Route exact path='/result' component={Result} />
    <Route exact path='/ndi' component={NDI} />
    </Switch>
  </BrowserRouter>
  )
}

export default App;
